import React from "react";
import { Container,Button, Row } from "reactstrap";
const UserExist = () => {
  return (
    <div>
      
      <Container className="my-0 mx-auto  justify-content-center">
        <Row><h2>Login or Signup</h2></Row>
        <Row><Button color="primary" className="m-4">Login</Button>
        <Button color="secondary" className="m-4">SignUp</Button></Row>
        
      </Container>
    </div>
  );
};

export default UserExist;
